informacaoComplementar:
O objeto da contratação visa garantir o funcionamento mínimo e seguro das unidades da SMTE, evitando a interrupção dos serviços públicos essenciais;
A contratação está amparada no inciso II do art. 75 da Lei nº 14.133/2021, por se tratar de aquisição de pequeno valor;

A estimativa de preços foi elaborada com base em pesquisa de mercado atualizada, conforme planilha anexa ao Termo de Referência;
A urgência na reposição dos materiais decorre da necessidade de manutenção corretiva em instalações físicas desgastadas, comprometendo a segurança e a continuidade dos serviços;

A contratação direta promove eficiência administrativa e economicidade, conforme previsto no Decreto Rio nº 50.797/2022;

